import React, { Component }      from 'react';
import { MdTabletMac, MdGridOn } from "react-icons/md";
import { GiConsoleController, 
         GiJigsawPiece, 
         GiOBrick, 
         GiPerspectiveDiceThree} from "react-icons/gi";

import { Butt  }                 from '../styles/Butt';
import { Head5 }                 from '../styles/Head5';
import Title                     from '../components/Title';

import { uxData } from "../data/UXData";

export default class Front_End extends Component {

  state = {
    uxDatas: uxData
  };


  render() {
    return (

      <section className="about"> 

        <div className="how-portfolio">
            <Title title="Front-end" />
            <div>

            <Head5>   Experienced Web Developer with a demonstrated history of working in the non-profit
              organization management industry. Skilled in User Experience (UX), WordPress, 
              User Interface Design, Web Design, and HTML. In-depth knowledge of Visual Basic 
              programming. Extensive knowledge in Microsoft Access, MS-SQL and Crystal Report. 
              Alumni of the Grow with Google Developer Scholarship in 2018 and have 
              completed Udacity's Front-End Developer nanodegree. 
            </Head5>

            </div>  
              <div className="portfolio-center outer-portfolio">
                {this.state.uxDatas.map((item, index) => {
                  return (
                  <article key={index} className="portfolio">
                    <span className="nav-link">{item.icon}</span>
                    <h6 className="nav-link">{item.title}</h6>
                      <form className="nav-link">
                        <Butt className="btn-upper" type="submit">
                          <a className="fEnd-link" href={item.github} 
                            target="_blank" rel={item.rel}>  GITHUB
                          </a>
                        </Butt>

                        <Butt className="btn-upper" type="submit">
                          <a className="fEnd-link" href={item.liveDemo} 
                            target="_blank" rel={item.rel}> LIVE DEMO
                         </a>
                         </Butt>
                      </form>
                    <p>{item.info}</p>

                  </article>
                  );
                })}
              </div>
        </div>
    </section>

    );
  }

}
